---
apiVersion: v1
kind: Namespace
metadata:
  name: circleci-server
---
# Docker registry sealed secret
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: regcred
  namespace: circleci-server
spec:
  encryptedData:
    .dockerconfigjson: 
  template:
    metadata:
      name: regcred
      namespace: circleci-server
    type: kubernetes.io/dockerconfigjson
---
# Encryption keys sealed secret
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: signing-keys
  namespace: circleci-server
spec:
  encryptedData:
    encryption-key: 
    signing-key: 
  template:
    metadata:
      name: signing-keys
      namespace: circleci-server
    type: Opaque
---
# Postgresql password sealed secret
apiVersion: bitnami.com/v1alpha1
kind: SealedSecret
metadata:
  name: postgresql
  namespace: circleci-server
spec:
  encryptedData:
    postgres-password: 
  template:
    metadata:
      name: postgresql
      namespace: circleci-server
    type: Opaque
---
