  namespace: circleci-server
spec:
  encryptedData:
    ca.pem: 
    cert.pem: 
    key.pem: 
  template:
    metadata:
      annotations:
        helm.sh/resource-policy: keep
        meta.helm.sh/release-name: circleci-server
        meta.helm.sh/release-namespace: circleci-server
      labels:
        app.kubernetes.io/managed-by: Helm
      name: nomad-mtls
      namespace: circleci-server
